import React from 'react';

const RadioButton = ({question, onChange, onBlur}) => {
    return (
        <div>
            <p>{question.label}:</p>
            <select
                name={question.key}
                value={question.value}
                onChange={onChange}
                onBlur={onBlur}>
            {question.data.map((item, key) => (
                <div key={key}>
                    <label>
                        <input type="radio" name={question.key} value={item.value}/>
                        {item.label}
                    </label><br/>
                </div>
            ))}
            </select>
            {question.error && <span>{question.error}</span>}
        </div>
    )
};

export default RadioButton;
